import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const fetchImages = async () => [
  { image_id: 1, filename: "0398b9c3f5bbab1c1d402cece24d4003.jpg", questions_count: 5 },
  { image_id: 2, filename: "123237.png", questions_count: 2 },
];

const ImagesPage = () => {
  const [images, setImages] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchImages().then(setImages);
  }, []);

  return (
    <div className="container">
      <h2>Images</h2>
      <div className="image-grid">
        {images.map((img) => (
          <div key={img.image_id} className="image-card" onClick={() => navigate(`/images/${img.image_id}`)}>
            <img src={`/images/${img.filename}`} alt={img.filename} />
            <p>{img.filename}</p>
            <p>{img.questions_count} questions</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ImagesPage;
